/*!50003 CREATE*/ /*!50017 DEFINER=`admin`@`%`*/ /*!50003 TRIGGER `diagnosis_order_tb_BEFORE_INSERT` BEFORE INSERT ON `diagnosis_order_tb` FOR EACH ROW BEGIN
	declare order_score_value double;
    declare score_pay_value double;
    
    select score_pay into score_pay_value
    from score_pay_tb as spt
    where year(now()) = year(spt.created_at)
    order by spt.created_at
    limit 1;
    
    select order_score into order_score_value
    from order_tb as ot
    where new.order_code = ot.order_code;
    
	set new.order_pay = round(order_score_value * score_pay_value, 0);

    set new.total_order_pay = round(new.order_count * new.order_days * new.order_pay, 0);
END */;;
